import React from 'react';
import {nanoid} from 'nanoid';
import Image from './Image';

const RenderImages = ({firstHunnit}) => {
    const imgElmts = [];

    for (const {url, altText} of firstHunnit){
        imgElmts.push(
            <Image
                url={url}
                altText={altText}
                key={nanoid()}
            />
        )
    };
    return imgElmts;
}

export default RenderImages;
